import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function createNote(contact){
    return <Note title={notes.title} content={notes.content}></Note>
}

function App() {
    return <div>
        <Header></Header>
        {notes.map(createNote(contact))}
        <Footer></Footer>
    </div>
}

export default App;

